// Parse OpenAI response - adapted to your actual format
const items = $input.all();
const results = [];

for (const item of items) {
  try {
    // 1. Get the `output` array from the response
    const output = item.json.output || item.json;

    let products = null;

    if (Array.isArray(output)) {
      // 2. Find the "message" object
      const messageObj = output.find(o => o.type === 'message') || output[0];

      if (messageObj && Array.isArray(messageObj.content)) {
        // 3. Find the "output_text" content block
        const textContent = messageObj.content.find(c => c.type === 'output_text') || messageObj.content[0];

        if (textContent && textContent.text) {
          const textObj = textContent.text;

          // 4. In your response, textObj looks like: { products: [ ... ] }
          if (Array.isArray(textObj.products)) {
            products = textObj.products;
          } else if (Array.isArray(textObj)) {
            // fallback if in some cases the model returns an array directly
            products = textObj;
          }
        }
      }
    }

    // 5. Add each product as a separate item
    if (products && Array.isArray(products)) {
      for (const product of products) {
        results.push({
          json: {
            product_name: product.product_name,
            provider: product.provider,
            interest_rate: product.interest_rate != null ? parseFloat(product.interest_rate) : null,
            min_income: product.min_income != null ? parseFloat(product.min_income) : null,
            min_credit_score: product.min_credit_score != null ? parseInt(product.min_credit_score) : null,
            max_credit_score: product.max_credit_score != null ? parseInt(product.max_credit_score) : null,
            min_age: product.min_age != null ? parseInt(product.min_age) : null,
            max_age: product.max_age != null ? parseInt(product.max_age) : null,
            employment_required: Boolean(product.employment_required),
            source_url: product.source_url,
            crawled_at: new Date().toISOString()
          }
        });
      }
    }

  } catch (error) {
    console.error('Parse error:', error.message);
  }
}

return results;

